const response = require('./data');
const {fetchRestaurants, searchBussines} = require('./services');
const map = require('./automapper');
const Person = require('./Person');
const RestaurantModel = require('./RestaurantModel');
const BusinessModel = require('./BussinesModel');

async function getRestaurants(){

  let data = await fetchRestaurants();

  let restaurants = map(RestaurantModel, data);
  
  console.log(restaurants);

}

async function search(){

  let data = await searchBussines();

  let bussiness = map(BusinessModel, data[0]);
  
  console.log(bussiness);

}

search();

